import botao from './nav.module.css';


export default function Menuh(){
    
    return(
        <div >
            <svg height="300" width="300" id="bot" className={botao.bot_h}>
            <path d="M 140 220 l 45 0"  stroke="yellow" stroke-width="3" fill="none" />
            <path d="M 175 240 l 30 0" stroke="white" stroke-width="3" fill="none" />
            <path d="M 190 260 l 15 0" stroke="white" stroke-width="3" fill="none" />
            </svg>
        </div>
    )
}
